export const learnerSchema = {
  version: 0,
  primaryKey: 'id',
  type: 'object',
  properties: {
      id: {
          type: 'string',
          maxLength: 100
      },
      name: {
          type: 'string'
      },
      done: {
          type: 'boolean'
      },
      updatedAt: {
          type: 'number'
      }
  },
  required: ['id', 'name', 'done', 'updatedAt']
}
